import React, { Component } from "react";
import { Redirect } from "react-router-dom";
import authStore from "../../store/authStore";
import { Card } from "react-bootstrap";
import category from "./data";
import { observer } from "mobx-react";

// Style
//import styles from "./styles";

class MiddleSchoolList extends Component {
  handleClick = () => {
    alert(`Hello`);
    // ("MiddleSchoolCategoryList", {
    //   categoryID: category.id,
    //   categoryName: category.name
    // });
  };
  render() {
    if (!authStore.user) return <Redirect to="/login" />;
    return (
      <Card button onClick={this.handleClick}>
        <Card.Body>{category.name}</Card.Body>
      </Card>
    );
  }
}

export default observer(MiddleSchoolList);
